import React, { useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";

export default function AddUrheilija() {
  const [etunimi, setEtunimi] = useState("-");
  const [sukunimi, setSukunimi] = useState("-");

  const handleSubmit = (event) => {
    event.preventDefault();
    axios
      .post("http://localhost:3000/urheilijat", { etunimi, sukunimi })
      .then((res) => {
        const palautus = res;
        console.log(palautus);
      });
  };

  return (
    <>
      <div className="child-div">
        <div className="form-box">
          <form onSubmit={handleSubmit}>
            <div className="field1">
              <label> Nimi: </label>

              <input
                placeholder="Etunimi"
                onChange={(event) => setEtunimi(event.target.value)}
              />

              <input
                placeholder="Sukunimi"
                onChange={(event) => setSukunimi(event.target.value)}
              />
            </div>

            <button type="submit" id="submitBtn" className="submitBtn">
              {" "}
              Tallenna uusi urheilija
            </button>
          </form>
        </div>
      </div>
    </>
  );
}

